import React from 'react';
import Footer from '../Footer/Footer';
import NavBar from '../Navbar/NavBar';
import TextField from '@mui/material/TextField';
import { makeStyles, multiTextField } from '@mui/styles';
import './SignUp.css'

const useStyles = makeStyles({
    field: {
        marginBottom: '20px'
    }
})


function SignUp() {

    const classes = useStyles()



   return(
       <>
           <NavBar/>
           <div className="signup">

               <div className="signupHeader">
                   <div className="backarrow">
                       <img src="https://res.cloudinary.com/do5wu6ikf/image/upload/v1684452441/starpenzu/back_qpybto.svg" alt=""/>
                   </div>

                   <div className="signupTitle">
                       Register
                   </div>
               </div>
               <form action="" className="register">
                   <TextField className={classes.field} id="outlined-basic" label="First Name" variant="outlined" type='text' />
                   <TextField  className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
                   <TextField className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
                   <TextField className={classes.field} id="outlined-basic" label="Outlined" variant="outlined" />
               </form>


           </div>

           <Footer/>
       </>

   )
}

export default SignUp;
